import styled from 'styled-components';


export const Container = styled.div`
    display: flex;
    justify-content: space-around;
    align-items: center;
    width: 100%;
    background: #FFFFFF;
    height: 7em;

    img{
        width: 15%;
    }
    #seacrhProducts, #informationUser{
        display: flex;
        align-items: flex-end;
        justify-content: space-between;
        flex-wrap: nowrap;
        flex-direction: row;
    }
`;
